window.bookSummaryJSON = "<p>This audiobook is 7 hours and 36 minutes, and the additional interviews are 4 hours and 35 minutes. </p> <p>Beqoming (noun verb): devotion to the process of becoming who you are designed to be by radically embracing your greatest challenges as curriculum and savoring the full spectrum of life.</p> <p>When Benjamin, a no-nonsense businessman, and Azrya, a free-spirited artist, fall madly in love, they birth a vision for a committed partnership capable of elevating humanity. But in order to become the heart-centered impact leaders they aspire to be, they must face off with the deepest unconscious fears threatening their mission and union.</p> <p>A unique hybrid of personal development, spiritual memoir, and erotic nonfiction, <i>Beqoming </i>is an intimate and uncensored exploration of psychedelics, sex, power, and purpose. Join Azrya and Benjamin Bequer as they navigate the light and shadow sides of their own beqoming and deliver potent wisdom and tangible strategies for your own activation.</p> <p>Warning: This book may inspire you to face off with your darkest subconscious shadows, claim your truest truth, and embody the greatness you’re here to share with the world. Side effects may include becoming radically unf--kwithable.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
